import "./EventItem.css";
import tennis from "../../assets/Images/tennis.jpg";

const EventItem = () => {
  return <div id="layoutEvents">
      <div id="eventBox">Sport : Beginner
      <div className="theImage"> <img src={tennis} alt="aa" />Username</div>
      </div>
      <div className="firstBox">

      <div className="boxDetails">
      <div>Location</div>
      <div>Date</div>
      <div>Empty slots</div>
      </div>
    </div>
  </div>
};
{/* <div className="theOwner">Here owner and name</div> */}

export default EventItem;
